INSERT INTO `postales` VALUES (1,'marruecos-1','/postal/Marruecos01.png','En los hogares de Marruecos el hombre es el encargado de servir el té.',10,1,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(2,'marruecos-2','/postal/Marruecos02.png','En Marruecos, mientras se bebe el té en una tienda, no es correcto hablar de precios ni negociar hasta que se vacíen los vasos.',10,1,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(3,'marruecos-3','/postal/Marruecos03.png','El té ocupa un puesto muy importante en la cultura de Marruecos y es considerada una expresión artística.',10,1,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(4,'marruecos-4','/postal/Marruecos04.png','En Marruecos no existe una forma estándar de preparación del té, y es habitual que cada marroquí lo prepare a su manera.',10,1,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(5,'marruecos-5','/postal/Marruecos05.png','Debido a su consumo, Marruecos es uno de los mayores importadores de té en el mundo.',10,1,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(6,'japon-1','/postal/Japon01.png','El té verde es el preferido por los japoneses. Esa variedad acapara el gusto de la gran mayoría de nipones.',10,2,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(7,'japon-2','/postal/Japon02.png','En Japón y otros países orientales, el té transporta a un estrado de solemnidad.',10,2,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(8,'japon-3','/postal/Japon03.png','En Japón debes degustar primero el té en su estado puro, sin añadir nada.',10,2,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(9,'japon-4','/postal/Japon04.png','El té fue introducido en Japón durante el siglo IX por los monjes budistas de China, donde se conocía, según la leyenda, desde hacía milenios.',10,2,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(10,'japon-5','/postal/Japon05.png','En las ciudades actuales, donde no hay mucho espacio, la ceremonia del té puede hacerse en cualquier lugar de la casa adaptado para ello; lo importante es ofrecer un entorno tranquilo con el espíritu de la ceremonia.',10,2,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(11,'india-1','/postal/India01.png','India es el mayor productor de té, y Assam, Darjeeling y Nilgiri, las principales regiones de cultivo. Comparte con tus amigos esta postal.',10,3,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(12,'india-2','/postal/India02.png','En India es casi obligatorio ofrecer un té a las visitas. Se considera mala educación rechazar el té que te ofrecen por primera vez.',10,3,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(13,'india-3','/postal/India03.png','Ya sea con leche o con azúcar, el té más consumido por la población de la India es el negro.',10,3,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(14,'india-4','/postal/India04.png','La India es el mayor productor de té que existe sobre la faz de la tierra.',10,3,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(15,'india-5','/postal/India05.png','Ya sea para desayunar, para beber por las tardes o en cualquier otro momento del día, el té se impone como la bebida por excelencia del pueblo indio.',10,3,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(16,'argentina-1','/postal/Argentina01.png','Argentina es el noveno productor de té en el mundo.',10,4,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(17,'argentina-2','/postal/Argentina02.png','La relación entrañable que tiene el té con Argentina, es la famosa ceremonia del té galés que se celebra regularmente en la Patagonia.',10,4,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(18,'argentina-3','/postal/Argentina03.png','El té comenzó a cultivarse en Argentina a principios del siglo XX, y desde hace años, muchas marcas internacionales utilizan en sus productos, el té cultivado en Argentina.',10,4,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(19,'argentina-4','/postal/Argentina04.png','La costumbre de tomar el té, traída principalmente por los inmigrantes europeos, se adoptó rápidamente, y la reunión en torno a él es cada vez más común. ',10,4,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(20,'argentina-5','/postal/Argentina05.png','Las personas se reúnen alrededor de la mesa para disfrutar de sándwiches, tortas, scones, una rica taza de té y mucha conversación.',10,4,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(21,'inglaterra-1','/postal/Inglaterra01.png','El té forma parte de la cotidianidad de las islas y una buena taza de té lo puede solucionar todo.',10,5,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(22,'inglaterra-2','/postal/Inglaterra02.png','En Inglaterra, después de remover el té, la cuchara se debe colocar  sobre el plato.',10,5,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(23,'inglaterra-3','/postal/Inglaterra03.png','Fue la duquesa Ana Russell quien inició la costumbre del té en Inglaterra a mediados del siglo XIX, como una forma de tomar un tentempié entre las largas horas.',10,5,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(24,'inglaterra-4','/postal/Inglaterra04.png','Los ingleses, a la hora de beber el té, lo beben sólo, con azúcar o con leche. Se inclinan generalmente por los \"blends\" y nunca lo sirven con crema.',10,5,'2017-04-11 16:18:58','2017-04-11 16:18:58'),(25,'inglaterra-5','/postal/Inglaterra05.png','En Inglaterra nunca se sopla por encima de la taza para que se enfríe, se considera de mal gusto. Se remueve con la cucharilla.',10,5,'2017-04-11 16:18:58','2017-04-11 16:18:58');
/*!40000 ALTER TABLE `postales` ENABLE KEYS */;
